import axios from 'axios'

const endpoint = `${process.env.REACT_APP_SERVER_SERVICE}/api/musics`;

class MusicService {
  static async createMusic(music) {
    try {
      const response = await axios.post(`${endpoint}`, music)
      return response.data
    } catch (error) {
      console.log(error)
    }
  }

  static async getMusics() {
    try {
      const response = await axios.get(`${endpoint}`)
      return response.data
    } catch (error) {
      console.log(error)
    }
  }

  static async deleteMusic(musicId) {
    try {
      const response = await axios.delete(`${endpoint}/${musicId}`)
      return response.data
    } catch (error) {
      console.log(error)
    }
  }
}
